import { FormsModule } from '@angular/forms';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { CommonModule } from '@angular/common';
import { HttpClientModule } from '@angular/common/http';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ModalModule } from 'ngx-bootstrap/modal';
import { ClientesComponent } from './components/clientes/clientes.component';
import { ClientesService } from './ClienteServico/clientes.service';
import { HomeComponent } from './components/home/home.component';
import { ListaClientesComponent } from './components/lista-clientes/lista-clientes.component';
import { ProdutosComponent } from './components/produtos/produtos.component';
import { ProdutosService } from './ProdutoServico/produtos.service';
import { FornecedoresService } from './FornecedorServico/fornecedores.service';
import { FornecedorComponent } from './components/fornecedores/fornecedores.component';

@NgModule({
  declarations: [
  AppComponent,
  ClientesComponent,
  HomeComponent,
  ListaClientesComponent,
  ProdutosComponent,
  FornecedorComponent
  ],
 imports: [
 BrowserModule,
 AppRoutingModule,
  CommonModule,
  HttpClientModule,
 ModalModule.forRoot()
 ],
 providers: [HttpClientModule, ClientesService],
  bootstrap: [AppComponent]
 })
 export class AppModule { }
